window.bookSummaryJSON = "<p>Against his will, Noctorno Hawthorne, an undercover cop, finds himself embroiled in magic, mayhem and a parallel universe. Too late, he meets an amazing woman only to find she’s destined for his identical twin in another world. And things aren’t going great there.</p> <p>Noc is recruited to help save that world. What he doesn’t know is his destined love resides in that world.</p> <p>Franka Drakkar wears a mask. A mask she never takes off to protect herself in a world of malice, intrigue and danger.</p> <p>When Franka meets Noc and he discovers her secrets, convinced she carries a midnight soul, having shielded herself from forming bonds with anyone, she struggles with accepting his tenderness and care.</p> <p>When Noc meets Franka, over wine and whiskey, her mask slips and Noc knows it’s her—only her—and he has to find a way to get her to come home with him.</p> <p>And then make her want to stay.</p>"; 
